import {useState} from 'react'
import Input from 'semantic-ui-react'

function Login(){
  const [userName, setUserName] = useState("")
  const [userPassword, setUserPassword] = useState("")

  function whatUserNamed(e){
    setUserName(e.target.value)
  }

  function whatUserPassworded(e){
    setUserName(e.target.value)
  }

  return (
    <div>
      <form>
      <label htmlFor="name" className="label">Name</label>
          <Input className="input" id="name" value={userName} onChange={whatUserNamed} type="text" placeholder="Your ame"></Input>
          <label htmlFor="userpassword" className="label">Your Password</label>
          <Input className="input" label='Password' id="userpassword" value={userPassword} onChange={whatUserPassworded} type="url" placeholder="Beer Image URL"></Input>
      </form>
    </div>
  )
}

export default Login
